In accordance with Article 23(1) of the Diplomatic Service Act, a Foreign Representation of the Republic of Bulgaria is headed by:
1. an ambassador extraordinary and plenipotentiary;

2. a permanent representative of the Republic of Bulgaria to international governmental organisations.

(2) A foreign representation of the Republic of Bulgaria may also be headed by:
1. a chargé d’affaires;

2. an interim chargé d’affaires;

3. a head of diplomatic office, liaison office or special mission;

4. a consul general;

5. a consul.

Under Article 13(1) of the Diplomatic Service Act, the Minister for Foreign Affairs appoints the following personnel to carry out certain foreign policy tasks:

1. ambassadors-at-large – diplomats of a rank no lower than ‘minister plenipotentiary’ or persons with proven qualifications and experience in performing the relevant tasks;

2. special coordinators – diplomats of a rank no lower than‘advisor’ or persons with proven qualifications and experience in performing the relevant tasks.

Ambassadors-at-large and special coordinators are dismissed at the discretion of the Minister for Foreign Affairs.
